import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
 public name: string = '';
 constructor(private route: ActivatedRoute, private router: Router) {}

 ngOnInit(): void {
  this.route.queryParams.subscribe((queryParam) => {
    this.name = queryParam['name'];
    console.log(queryParam);
  })
 }

 toHomePage() {
    this.router.nag
 }
}
<div class="loginpage">
    <h2>LOGIN</h2>
    <label for="username">Username: </label>
    <input type="text" id="username" name="username"><br><br>
    <label for="password">Password: </label>
    <input type="text" id="password" name="password"><br><br>
    <!-- <input type="submit" id="submit" value="Submit"><br> -->
    <div class="submit_button">
        <button class="button submit" id="submit">Submit</button><br><br>
    </div>

    <button class="button guest" id="guest" (click)="toHomePage()">Continue as a Guest</button><br><br>
    <button class="button create" id="create">Create an account</button>
</div>
